import React from 'react';
import './nav.css';


function Nav()
{
  return  (
    <div className = "NavDiv">

    <ul>
    	<li><a href="/">Home</a></li>
    	<li><a href="/collections">Collections</a></li>
    	<li><a href="/addpicture">Upload</a></li>
      <li><a href="/stats">Statistics</a></li>
    </ul>

    </div>
  );

}

export default Nav;
